import React from "react";
import Loading from "./Loading";

export default function About() {
  return (
    <div className="p-5 text-center container">
      <h1 className="display-3 text-warning">About Flixify</h1>
      <p className="text-white">
        Web application for browsing movings and TV shows; users can watch
        trailers, find cast members, similar media, and an overview describing
        the media selected
      </p>
      <p className="text-light display-4">Version 1.0.0</p>
      <Loading />
    </div>
  );
}
